import React from 'react';

export default class Log extends React.Component {
  state = {
    name: 'gdhdgh',
  };
  changeEmile = (ev) => {
    this.setState({ email: ev.target.value });
  };
  iconOne = () => {
    this.setState(() => {
      return { icon: <i class='fas fa-heartbeat'></i> };
    });
  };

  Ren = (ev) => {
    ev.preventDefault();
    this.props.Ren(this.state.name);
  };
  render() {
    return (
      <form onSubmit={this.Ren}>
        <input type='email' placeholder='Email' onChange={this.changeEmail} />
        <input
          type='password'
          placeholder='Password'
          minLength='6'
          onChange={this.changeEmile}
        />
        <button>
          <b> Login in</b>
        </button>
      </form>
    );
  }
}
